Alert PM10 Levels:
For: ${location} ${city} ${country} ${latitude}/${longitude}
Value: ${value}
As of ${date}
Last updated:  ${lastUpdated}

51 to 100 is Moderate unhealthy (Mask up or stay inside)
101 to 150 is Unhealthy for some
151 to 200 is Unhealthy
201 to 300 is Increased Health Risk
301+ is a High Health Warning

See:  https://www.airnow.gov/aqi/aqi-basics/
